async () => {
  let data = await LoadFavorecidosAPI.run().catch(() => {
    showAlert("Erro na requisição dos dados");
  });
  let lista_favorecidos = [];
  for (var e of data) {
    lista_favorecidos.push({
      'label': e['nome'],
      'value': e['id']
    });
  }
  await storeValue("favorecidos", lista_favorecidos);
}

